import React from 'react';
import { useState } from 'react';
import LoaderHeading from './util/LoaderHeading';
import ExamCard from './util/ExamCard';

function ViewExams() {

    const [fetchedData, setFetchedData] = useState([]);
    const [pages, setPages] = useState(0);
    var admins = [];

    async function getData(url) {
        const response = await fetch(url, {
            method: 'GET'
        });
        return response.json(); 
    }



    const loadExams = () => {
        let URL = 'http://localhost:8080/UploadToS3/admins?page=';
        URL = page
        let entityPerPage = 3;
        getData(URL)
        .then(data => {
            console.log(data);
            setFetchedData(data.data);
            console.log(fetchedData);
            setPages(Math.ceil(data.count/entityPerPage));
        });
    }

    return (
    <>
        <LoaderHeading 
            description='Exams'
        />
        <div className='content-loaded'>
            <div>
                <button onClick={loadExams}>Fetch</button>
                <div>
                    {

                        fetchedData.map((d, key) => {
                            return <ExamCard 
                                key={key}
                                firstName={d.firstName}
                                lastName={d.lastName}
                                email={d.email}
                                contact={d.contact}
                            />
                        })
                    }
                </div>
            </div>
        </div>
    </>
    );
}

export default ViewExams;
